import { BrowserRouter, Switch } from 'react-router-dom';
import './App.scss';

// import { BrowserRouter, Switch, Route } from "react-router-dom";

import NavBar from './components/NavBar/NavBar';

import HomePage from './pages/HomePage/HomePage';

function App() {
  return (
    <div>
      <BrowserRouter>
        <NavBar/>

        <Switch>
          <Route exact path="/" component={HomePage} />
        </Switch>
      </BrowserRouter>

      <article>
        <h1>Hi, I'm Laurie.</h1>
        <p>I am a full-stack web developer, currently based in Kamloops, BC. My toolbox includes React, JavaScript, HTML, CSS, Sass, Node, Express & MySQL. I am passionate about action sports and the outdoors.</p>
        <button>Learn More</button>
      </article>

    </div>
  );
}

export default App;
